// Actions check_tokens
export const SetTokensList = (token) => dispatch =>  { 
  return dispatch => {
    setTimeout( () => {
      dispatch(
        {
            type: "SET_NAME",
            payload: token
        }
      )
    }, 2000)
  }
}


